const NavBar = () => {
    let pages = [
        {text: "Google", url: "https://www.google.com/"},
        {text: "Github", url: "https://www.github.com/"}
    ]

    let navItems = [];

    pages.forEach( ref => {
        navItems.push(<a href={ref.url} >{ref.text}</a>)
    })

  return (
    <nav>
        {navItems}

        {pages.map((f) => {
        return <li key={f.url}>{f.text}</li>
      })}
    </nav>
  )
}

export default NavBar
